import React from 'react';
import { Route, BrowserRouter } from 'react-router-dom';
//importando paginas
import Home from './pages/Home';


const Routes = () => {
    return (
        <BrowserRouter>
            <Route component={Home} path="/" exact />
        </BrowserRouter>
    );
}

export default Routes;
